import AddToDo from '../components/add-to-do';

const Index = () => {
  const [todo, setTodo] = useState([]);

  return (
    <>
      <AddToDo setTodo={setTodo} />
      <ToDoList todo={todo} />
    </>
  );
};

export default Index;
